import "./styles.css"
import Horario from "../Horario/Horario"

export default function Dia({ weekday, date, showtimes}) {
    return (
        <div className="dia" >
            {`${weekday} - ${date}`}
            <div className="horario-box" >
                {showtimes.map((showtime) => (
                    <Horario
                        name={showtime.name}
                        id={showtime.id}
                    />))}

            </div>
        </div>
    )
}
